gql:
mutation register($register_user: RegisterInput!) {
  users {
    publicUsers {
      register(user: $register_user) {
        registered
        hasError
      }
    }
  }
}
query login($password_user: LoginInput!) {
  users {
    publicUsers {
      login {
        password(user: $password_user) {
          accessToken
        }
      }
    }
  }
}
